                            <td>{user.email}</td>
                            <td>{user.role}</td>
                        </tr>
                    </tbody>
                ))} */}
                {props.items.map((user) => (
                    <SpecificUserData
                        key={user.id}
                        id={user.id}
                        name={user.name}
                        email={user.email}
                        role={user.role}
                        deleteSpecificUser={props.ondeleteHandler}
                    />

                ))}
            </table>

        </div>
    );
}

export default UserData;
